/*------------------------------- Area Modulo Controller --------------------------------*/
// angular.module se compone de ('Nombre del modulo',[dependencias]) Inyectables
var app = angular.module("simuladorCreditos", ['ngMaterial', 'ngSanitize']);
/*------------------------------- Area Modulo Controller --------------------------------*/


/*------------------------------- Area Modulo Controller --------------------------------*/
//.controller ('Nombre Controller', directiva en function($scope)) Inyectables
app.controller('simuladorCreditos_Controller', [
    '$location',
    '$scope',
    '$timeout',
    '$rootScope',
    '$http',
    '$filter',
    function($location, $scope, $timeout, $rootScope, $http, $filter) {
        /*--------------------------    Area de Declaracion     ------------------------------*/
        //*************************(  Contenido del controller )********************************
        $scope.periodoAmortizacion = 0;
        $scope.factoresInteres = "";
        $scope.total = 0;
        $scope.anios = 0;
        $scope.meses = 0;
        $scope.prestamo;
        $scope.efectivoAnual;
        $scope.nominalAnual;
        $scope.periodica;
        $scope.tabla = [];
        $scope.rows = [];


        /*--------------------------            $apis           ------------------------------*/
        //*************************(  Consulta a Base de Datos )********************************
        $scope.$api = {};
        //**************************************************************************************
        /*--------------------------            $apis           ------------------------------*/





        /*--------------------------            $gui            ------------------------------*/
        //*************************(  Ejecuciones de la pantalla )******************************
        $scope.$gui = {
            ejemplo: function() {
                $scope.variable = "Nuevo Valor pantalla";
            },
            efectivoAnualIngresado: function() {

                if (Number($scope.efectivoAnual) > 9999999999999) {
                    $scope.efectivoAnual = 0;
                } else {
                    $scope.efectivoAnualHomologo = $scope.efectivoAnual;
                    $scope.nominalAnual = 0;
                    $scope.nominalAnualHomologo = 0;
                    $scope.periodica = 0;
                    $scope.periodicaHomologo = 0;
                    $scope.periodica = Math.pow((1 + (Number($scope.efectivoAnual) / 100)), (Number($scope.periodo.split(",")[0]) / 360)) - 1;
                    $scope.periodicaHomologo = ((Math.pow((1 + (Number($scope.efectivoAnual) / 100)), (Number($scope.periodo.split(",")[0]) / 360)) - 1) * 100).toFixed(2);
                    $scope.nominalAnual = Number($scope.periodica * Number($scope.periodo.split(",")[1]));
                    $scope.nominalAnualHomologo = (Number($scope.periodica * Number($scope.periodo.split(",")[1])) * 100).toFixed(2);
                }
            },
            calculoNominalAnual: function() {
                if (Number($scope.nominalAnual) > 9999999) {
                    $scope.nominalAnual = 0;
                } else {
                    $scope.nominalAnualHomologo = $scope.nominalAnual;
                    $scope.efectivoAnual = 0;
                    $scope.efectivoAnualHomologo = 0;
                    $scope.periodica = 0;
                    $scope.periodicaHomologo = 0;
                    $scope.periodica = (Number($scope.nominalAnual) / 100) / Number($scope.periodo.split(",")[1]);
                    $scope.periodicaHomologo = (((Number($scope.nominalAnual) / 100) / Number($scope.periodo.split(",")[1])) * 100).toFixed(2);
                    $scope.efectivoAnual = Math.pow(1 + Number($scope.periodica) / 100, (360 / Number($scope.periodo.split(",")[0]))) - 1;
                    $scope.efectivoAnualHomologo = ((Math.pow(1 + Number($scope.periodica), (360 / Number($scope.periodo.split(",")[0]))) - 1) * 100).toFixed(2);
                }
            },
            calculoPeriodico: function() {
                if (Number($scope.periodica) > 99999) {
                    $scope.periodica = 0;
                } else {
                    $scope.periodicaHomologo = $scope.periodica;
                    $scope.efectivoAnual = 0;
                    $scope.efectivoAnualHomologo = 0;
                    $scope.nominalAnual = 0;
                    $scope.nominalAnualHomologo = 0;
                    $scope.nominalAnual = (Number($scope.periodica) / 100) * Number($scope.periodo.split(",")[1]);
                    $scope.nominalAnualHomologo = (((Number($scope.periodica) / 100) * Number($scope.periodo.split(",")[1])) * 100).toFixed(2);
                    $scope.efectivoAnual = Math.pow(1 + (Number($scope.periodica) / 100), (360 / Number($scope.periodo.split(",")[0]))) - 1;
                    $scope.efectivoAnualHomologo = ((Math.pow(1 + (Number($scope.periodica) / 100), (360 / Number($scope.periodo.split(",")[0]))) - 1) * 100).toFixed(2);
                }
            },
            calcular: function() {
                var numeroCuotas = 0;
                var aniosSobrantes = 0;
                var cuotaIndex = 0;
                var fechaHoy = new Date();
                var cuotaFija = 0;

                if ($scope.tipoPrestamo == "periodoGracia") {
                    $scope.tabla = [];
                    numeroCuotas = (Number($scope.anios) - 3) * Number($scope.periodo.split(",")[1]);
                    aniosSobrantes = 3 * Number($scope.periodo.split(",")[1]);
                    saltosAnios = (Number($scope.periodo.split(",")[1]) == 12 ? 1 : (Number($scope.periodo.split(",")[1]) == 6 ? 2 : 3));
                    $scope.tabla.push({
                        numeroCuota: cuotaIndex,
                        numeroCuotaHomologo: cuotaIndex,
                        fecha: fechaHoy,
                        fechaHomologo: $filter('date')(fechaHoy, 'dd/MM/yyyy'),
                        saldoCapital: Number($scope.prestamo),
                        saldoCapitalHomologo: $filter('currency')($scope.prestamo),
                        amortizacionCapital: '$0.00',
                        amortizacionCapitalHomologo: '$0.00',
                        amortizacionInteres: '$0.00',
                        amortizacionInteresHomologo: '$0.00',
                        cuotaFija: '$0.00',
                        cuotaFijaHomologo: '$0.00',
                        flujoCaja: Number($scope.prestamo),
                        flujoCajaHomologo: $filter('currency')($scope.prestamo)
                    });
                    cuotaIndex++;
                    fechaHoy = new Date(fechaHoy.setMonth(fechaHoy.getMonth() + saltosAnios));
                    saldoCapital = Number($scope.prestamo);
                    for (var i = 0; i < aniosSobrantes; i++) {
                        amortizacionInteres = $scope.$gui.formulaInteres(saldoCapital, $scope.periodica);
                        saldoCapital = saldoCapital + $scope.$gui.formulaInteres(saldoCapital, $scope.periodica);
                        $scope.tabla.push({
                            numeroCuota: cuotaIndex,
                            numeroCuotaHomologo: "(" + cuotaIndex + ") Período de Gracia",
                            fecha: fechaHoy,
                            fechaHomologo: $filter('date')(fechaHoy, 'dd/MM/yyyy'),
                            saldoCapital: saldoCapital, // Calculando
                            saldoCapitalHomologo: $filter('currency')(saldoCapital),
                            amortizacionCapital: '$0.00',
                            amortizacionCapitalHomologo: '$0.00',
                            amortizacionInteres: amortizacionInteres, // Calculando
                            amortizacionInteresHomologo: $filter('currency')(amortizacionInteres),
                            cuotaFija: '$0.00',
                            cuotaFijaHomologo: '$0.00',
                            flujoCaja: "+ " + amortizacionInteres,
                            flujoCajaHomologo: "+ " + $filter('currency')(amortizacionInteres)
                        });
                        cuotaIndex++;
                        fechaHoy = new Date(fechaHoy.setMonth(fechaHoy.getMonth() + saltosAnios));
                    }
                    for (var i = 0; i < numeroCuotas; i++) {
                        cuotaFija = $scope.$gui.formularAnualidad(saldoCapital, $scope.periodica, numeroCuotas)
                        amortizacionInteres = $scope.$gui.formulaInteres(saldoCapital, $scope.periodica);
                        amortizacionCapital = Number(cuotaFija) - Number(amortizacionInteres);
                        saldoCapital = saldoCapital - cuotaFija;
                        $scope.tabla.push({
                            numeroCuota: cuotaIndex,
                            numeroCuotaHomologo: cuotaIndex,
                            fecha: fechaHoy,
                            fechaHomologo: $filter('date')(fechaHoy, 'dd/MM/yyyy'),
                            saldoCapital: saldoCapital,
                            saldoCapitalHomologo: $filter('currency')(saldoCapital),
                            amortizacionCapital: amortizacionCapital,
                            amortizacionCapitalHomologo: $filter('currency')(amortizacionCapital),
                            amortizacionInteres: amortizacionInteres,
                            amortizacionInteresHomologo: $filter('currency')(amortizacionInteres),
                            cuotaFija: cuotaFija,
                            cuotaFijaHomologo: $filter('currency')(cuotaFija),
                            flujoCaja: "- " + cuotaFija,
                            flujoCajaHomologo: "- " + $filter('currency')(cuotaFija)
                        });
                        cuotaIndex++;
                        fechaHoy = new Date(fechaHoy.setMonth(fechaHoy.getMonth() + saltosAnios));
                    }
                } else if ($scope.tipoPrestamo == "cuotaFija") {
                    $scope.tabla = [];
                    saldoCapital = Number($scope.prestamo);
                    numeroCuotas = Number($scope.anios) * Number($scope.periodo.split(",")[1]);
                    saltosAnios = (Number($scope.periodo.split(",")[1]) == 12 ? 1 : (Number($scope.periodo.split(",")[1]) == 6 ? 2 : 3));
                    $scope.tabla.push({
                        numeroCuota: cuotaIndex,
                        numeroCuotaHomologo: cuotaIndex,
                        fecha: fechaHoy,
                        fechaHomologo: $filter('date')(fechaHoy, 'dd/MM/yyyy'),
                        saldoCapital: Number($scope.prestamo),
                        saldoCapitalHomologo: $filter('currency')($scope.prestamo),
                        amortizacionCapital: '$0.00',
                        amortizacionCapitalHomologo: '$0.00',
                        amortizacionInteres: '$0.00',
                        amortizacionInteresHomologo: '$0.00',
                        cuotaFija: '$0.00',
                        cuotaFijaHomologo: '$0.00',
                        flujoCaja: Number($scope.prestamo),
                        flujoCajaHomologo: $filter('currency')($scope.prestamo)
                    });
                    cuotaIndex++;
                    fechaHoy = new Date(fechaHoy.setMonth(fechaHoy.getMonth() + saltosAnios));
                    for (var i = 0; i < numeroCuotas; i++) {
                        cuotaFija = $scope.$gui.formularAnualidad(saldoCapital, $scope.periodica, numeroCuotas)
                        amortizacionInteres = $scope.$gui.formulaInteres(saldoCapital, $scope.periodica);
                        amortizacionCapital = Number(cuotaFija) - Number(amortizacionInteres);
                        saldoCapital = saldoCapital - cuotaFija;
                        $scope.tabla.push({
                            numeroCuota: cuotaIndex,
                            numeroCuotaHomologo: cuotaIndex,
                            fecha: fechaHoy,
                            fechaHomologo: $filter('date')(fechaHoy, 'dd/MM/yyyy'),
                            saldoCapital: saldoCapital,
                            saldoCapitalHomologo: $filter('currency')(saldoCapital),
                            amortizacionCapital: amortizacionCapital,
                            amortizacionCapitalHomologo: $filter('currency')(amortizacionCapital),
                            amortizacionInteres: amortizacionInteres,
                            amortizacionInteresHomologo: $filter('currency')(amortizacionInteres),
                            cuotaFija: cuotaFija,
                            cuotaFijaHomologo: $filter('currency')(cuotaFija),
                            flujoCaja: "- " + cuotaFija,
                            flujoCajaHomologo: "- " + $filter('currency')(cuotaFija)
                        });
                        cuotaIndex++;
                        fechaHoy = new Date(fechaHoy.setMonth(fechaHoy.getMonth() + saltosAnios));
                    }
                }
                $scope.$complexSystem.armarRows();
            },
            formularAnualidad: function(P, ip, n) {
                return Number(P) * ((Math.pow(1 + Number(ip), Number(n)) * Number(ip)) / (Math.pow(1 + Number(ip), Number(n)) - 1));
            },
            formulaInteres: function(saldo, ip) {
                return Number(saldo) * Number(ip);
            },
            resetTasa: function() {
                $scope.efectivoAnual = 0;
                $scope.efectivoAnualHomologo = 0;
                $scope.nominalAnual = 0;
                $scope.nominalAnualHomologo = 0;
                $scope.periodica = 0;
                $scope.periodicaHomologo = 0;
            },
            resetTasaOption: function() {
                $scope.factoresInteres = "";
            }
        };
        //**************************************************************************************
        /*--------------------------            $gui            ------------------------------*/






        /*--------------------------           $watchers          ------------------------------*/
        //************************* (    Ejecuciones Simples  ) ********************************
        // $scope.$watch("identificacion",function(newValue,oldValue) {
        //
        //    if (newValue===oldValue) {
        //      return;
        //    }
        //
        //    $scope.identificacion = $filter('number')(newValue);
        //  });
        //**************************************************************************************
        /*--------------------------           $watchers           -----------------------------*/





        /*--------------------------        $complexSystem      ------------------------------*/
        //*************************(    Ejecuciones Complejas ) ********************************
        $scope.$complexSystem = {
            RegExpNombre: function() {
                var reg = /^([A-Za-zÁÉÍÓÚñáéíóúÑ]{0}?[A-Za-zÁÉÍÓÚñáéíóúÑ\']+[\s])+([A-Za-zÁÉÍÓÚñáéíóúÑ]{0}?[A-Za-zÁÉÍÓÚñáéíóúÑ\'])+[\s]?([A-Za-zÁÉÍÓÚñáéíóúÑ]{0}?[A-Za-zÁÉÍÓÚñáéíóúÑ\'])?$/g;
                if (reg.test($scope.nombre)) {
                    return true;
                } else {
                    return false;
                }


            },
            reCalcularMeses: function() {
                $scope.total = $scope.anios + " / " + (Number($scope.anios) * 12);
            },
            validarAnios: function() {
                if (Number($scope.anios) < 3 || Number($scope.anios) > 7) {
                    $scope.anios = 0;
                }
            },
            downloadPDF: function() {
                var docDefinition = {
                    pageOrientation: 'landscape',
                    content: [{
                            image: 'data:image/png;base64,',
                            width: 200
                        },
                        {
                            text: 'Resumen de Cuadro de Amortización Cuota Fija',
                            style: 'header'
                        },
                        {
                            text: '',
                            style: 'header'
                        },
                        {
                            text: '',
                            style: 'header'
                        },
                        {
                            text: '',
                            style: 'header'
                        },
                        'En el siguiente documento se entrega al cliente ' + $scope.nombre + ' con el objetivo de mantener la información negociada el mes ' + (new Date().getMonth() + 1) + ' del año ' + new Date().getFullYear(), {
                            text: 'Nombre:',
                            style: 'subheader'
                        },
                        $scope.nombre, {
                            text: 'ID:',
                            style: 'subheader'
                        },
                        $filter('number')($scope.identificacion), {
                            text: 'Valor Prestamo:',
                            style: 'subheader'
                        },
                        $filter('currency')($scope.prestamo), {
                            text: 'Tipo Préstamo:',
                            style: 'subheader'
                        },
                        $scope.tipoPrestamo == 'cuotaFija' ? 'Cuota fija' : 'Período de gracia', {
                            text: 'Plazo en Años/Meses:',
                            style: 'subheader'
                        },
                        $scope.total, {
                            text: 'Periodo de amortización:',
                            style: 'subheader'
                        },
                        $scope.periodo.split(",")[0] == '30' ? 'Mensual' : ($scope.periodo.split(",")[0] == '60' ? 'Bimestral' : 'Trimestral'), {
                            text: 'Tasas de Interes:',
                            style: 'subheader'
                        }, {
                            style: 'tableExample',
                            table: {
                                body: [
                                    ['Efectiva Anual', 'Nominal Anual', 'Periodica'],
                                    [$filter('porcentaje')($scope.efectivoAnualHomologo), $filter('porcentaje')($scope.nominalAnualHomologo), $filter('porcentaje')($scope.periodicaHomologo)]
                                ]
                            }
                        }, {
                            text: 'Cuadro de Amortización:',
                            style: 'subheader'
                        }, {
                            style: 'tableExample',
                            table: {

                                widths: ['auto', 'auto', 'auto', 'auto', 'auto', 'auto', 'auto'],
                                body: $scope.rows
                            },
                            layout: {
                                hLineWidth: function(i, node) {
                                    return (i === 0 || i === node.table.body.length) ? 2 : 1;
                                },
                                vLineWidth: function(i, node) {
                                    return (i === 0 || i === node.table.widths.length) ? 2 : 1;
                                },
                                hLineColor: function(i, node) {
                                    return (i === 0 || i === node.table.body.length) ? 'black' : 'gray';
                                },
                                vLineColor: function(i, node) {
                                    return (i === 0 || i === node.table.widths.length) ? 'black' : 'gray';
                                },
                                // paddingLeft: function(i, node) { return 4; },
                                // paddingRight: function(i, node) { return 4; },
                                // paddingTop: function(i, node) { return 2; },
                                // paddingBottom: function(i, node) { return 2; },
                                // fillColor: function (i, node) { return null; }
                            }
                        }
                    ],
                    images: {

                        building: 'data:image/jpeg;base64,'
                    },
                    styles: {
                        header: {
                            fontSize: 18,
                            bold: true,
                            margin: [0, 0, 0, 10]
                        },
                        subheader: {
                            fontSize: 16,
                            bold: true,
                            margin: [0, 10, 0, 5]
                        },
                        tableExample: {
                            margin: [0, 5, 0, 15]
                        },
                        tableHeader: {
                            bold: true,
                            fontSize: 13,
                            color: 'black'
                        }
                    }
                };

                //pdfMake.createPdf(docDefinition).download('PDF.pdf');
                pdfMake.createPdf(docDefinition).open();

            },
            armarRows: function() {
                $scope.rows = [];
                $scope.rows.push([
                    '# Cuota',
                    'Fecha',
                    'Saldo de Capital',
                    'AMORTIZACIÓN A CAPITAL',
                    'AMORTIZACIÓN A INTERES',
                    'CUOTA FIJA',
                    'FLUJO DE CAJA'
                ]);
                angular.forEach($scope.tabla, function(value, key) {
                    $scope.rows.push([
                        value.numeroCuotaHomologo,
                        value.fechaHomologo,
                        value.saldoCapitalHomologo,
                        value.amortizacionCapitalHomologo,
                        value.amortizacionInteresHomologo,
                        value.cuotaFijaHomologo,
                        value.flujoCajaHomologo
                    ]);
                });
            }
        };
        //**************************************************************************************
        /*--------------------------        $complexSystem      ------------------------------*/




        /*--------------------------            Arranque         ------------------------------*/
        $scope.includeMobileTemplate = false;
        var screenWidth = window.innerWidth;
        if (screenWidth < 700) {
            $scope.includeMobileTemplate = true;
        }
        $scope.myHTML = $scope.includeMobileTemplate ? '<h3>Tipo Préstamo </h3><br>' : '<p>Tipo Préstamo:</p>';
        var esto = $location.search();
        console.log(esto);
        $scope.tabla.push({
            numeroCuota: 0,
            numeroCuotaHomologo: '0',
            fecha: new Date(),
            fechaHomologo: $filter('date')(new Date(), 'dd/MM/yyyy'),
            saldoCapital: 0,
            saldoCapitalHomologo: '$0.00',
            amortizacionCapital: 0,
            amortizacionCapitalHomologo: '$0.00',
            amortizacionInteres: 0,
            amortizacionInteresHomologo: '$0.00',
            cuotaFija: 0,
            cuotaFijaHomologo: '$0.00',
            flujoCaja: 0,
            flujoCajaHomologo: '$0.00'
        });
    }
])
