/*--------------------------------------------Filters------------------------------------------------*/

app.filter('porcentaje', ['$filter', function($filter) {
    var regExpNumber = /^([0-9]|[1-9][0-9]|[1-9][0-9][0-9])$/g;
    return function(input) {
        number = Number(input);
        if (!isNaN(number)) {
            return (number) + '%';
        } else {
            return 0 + '%';
        }

    };

}]);

